import React from 'react'

function Room({ room }) {
  return (
    <div className='row'>
      <div className='col-md-5'>
        <img href='https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.thespruce.com%2Fput-together-a-perfect-guest-room-1976987&psig=AOvVaw2lmZugHv3vwvg3bk37t5lk&ust=1687586698060000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCID02r7c2P8CFQAAAAAdAAAAABAE' alt='' />
      </div>
      <div className='col-md-7'>
        <h1>{room.name}</h1>
        <p></p>
      </div>

    </div>
  )
}

export default Room;
